import React from "react";

function SetPlus (props) {
  return (
    <div className="BUTTON">
      <button type="button" onClick={props.onClick}>Сменить статус</button>
      <RedactionStatus onChange={props.onChange} status={props.status} />
    </div>
  )
}

function RedactionStatus (props) {
  return (
    <div>
      <input onChange={props.onChange} value={props.status} type="text" name="redaction" />
    </div>
  )
}

export default SetPlus
